import '../css/navbar.css';
import React from 'react';

class Topnav extends React.Component {
    render() {
        return (
            <div class="topnav">
                <ul>
                    <li className="navlinks" href="#home">Home</li>
                    <li className="navlinks" href="#news">About</li>
                    <li className="navlinks" href="#contact">Projects</li>
                    <li className="navlinks" href="#about">Contact</li>
                </ul>
            </div>
        );
    }
}

export default Topnav;
